column9:
Cordial saludo;

Solicito de su colaboración para que me sea enviado un catálogo de las películas que tienen en su inventario.

Agradezco su colaboración y quedo atento a sus comentarios.

por favor me pueden informar si tienen de Ricardo ray;
el diferente.10 aniversario, los durisimos, y el costo de cada uno.
Gracias.

Buen día;

Me comunico para consultarles si es posible conseguir una colección especial que contenga la disco-grafía de jorge Drexler, si es así que costo tiene?

Quedo Atenta;

Saludos;

Buenas tardes;

Estoy buscando hace tiempo la película "Satanás", en DVD o Blu-ray y necesito comprarla hoy mismo. ¿La tienen disponible? ¿En cuál tienda?

Muchas gracias!

Buenas tardes. Cuanto cuestan los albunes:
 Chopin Nocturnes for Piano & Strings, 
Mozart: Piano Concerto No. 21 con la academia de san Martin en los Campos;
Schumann & Brahms Sonatas y Romances; 
Modern Times. de la pianista Coreana YEOL SEUM SON.
y el disco de JOE HISASHI  Departure. cuanto debo dar de adelanto y en cuanto tiempo los traen? muchas gracias.

